INSERT INTO `course` VALUES (21,'Gender bias manifested through barriers','As a covert form of gender discrimination, gender bias involves barriers that stem from cultural beliefs about gender and workplace structures and practices. These barriers entail non-reflects acts of exclusion that are supported by gender norms and practices. The accumulation of these barriers can hinder women\'s ability to see themselves as leaders and the ability of others to see them as leaders (Diehl & Dzubinski, 2017; Ely, et al., 2011).','teach','English','Hashir Sheikh','2021-12-06 12:01:30','PNU','2021-12-26 15:00:16','{\'videolink\':\'http://duroobdubai.hopto.org:8095/PNU/assets/content/s1.mp4\', \'updated\':\'26/12/2021 10:45\'}','{\'scene_data\':[{\'enable_from\':\'00:00:00\',\'enable_to\':\'00:49:00\',\'language\':\'English\',\'characters_info\':[{\'characterName_en\':\'Reema\',\'characterName_ar\':\'ريما\',\'height\':-1,\'angle\':-60,\'distance\':25},{\'characterName_en\':\'Omar\',\'characterName_ar\':\'عمر\',\'height\':-5.5,\'angle\':-68,\'distance\':25},{\'characterName_en\':\'Sultan\',\'characterName_ar\':\'سلطان\',\'height\':-6.5,\'angle\':-80,\'distance\':25},{\'characterName_en\':\'Sarah\',\'characterName_ar\':\'سارة\',\'height\':3.5,\'angle\':-107,\'distance\':25},{\'characterName_en\':\'Leen\',\'characterName_ar\':\'لين\',\'height\':0,\'angle\':-98,\'distance\':30},{\'characterName_en\':\'Ali\',\'characterName_ar\':\'علي\',\'height\':2,\'angle\':-92,\'distance\':30},{\'characterName_en\':\'Farah\',\'characterName_ar\':\'فرح\',\'height\':1,\'angle\':-80,\'distance\':30},{\'characterName_en\':\'Mohammed\',\'characterName_ar\':\'محمد\',\'height\':1,\'angle\':-68,\'distance\':30}]},{\'enable_from\':\'00:50:00\',\'enable_to\':\'01:44:00\',\'language\':\'English\',\'characters_info\':[{\'characterName_en\':\'Reema\',\'characterName_ar\':\'ريما\',\'height\':6.5,\'angle\':-143,\'distance\':25},{\'characterName_en\':\'Omar\',\'characterName_ar\':\'عمر\',\'height\':6.5,\'angle\':-