INSERT INTO `local` VALUES (1,NULL,'avc',NULL,NULL,NULL,'2021-11-17 07:48:45',NULL,'2021-11-17 07:48:45'),(2,21,'coursename','Gender bias manifested through barriers','English','Hashir','2021-11-17 08:42:55','PNU','2021-12-08 06:22:23'),(3,21,'description','As a covert form of gender discrimination, gender bias involves barriers that stem from cultural beliefs about gender and workplace structures and practices. These barriers entail non-reflects acts of exclusion that are supported by gender norms and practices. The accumulation of these barriers can hinder women\'s ability to see themselves as leaders and the ability of others to see them as leaders (Diehl & Dzubinski, 2017; Ely, et al., 2011).','English','Hashir','2021-11-17 08:42:55','PNU','2021-12-08 06:32:21'),(4,22,'coursename','Interpersonal communication in leadership','English','Hashir','2021-11-17 09:05:07','PNU','2021-12-08 06:38:40'),(5,22,'description','Interpersonal communication in leadership','English','Hashir','2021-11-17 09:05:07','PNU','2021-11-23 09:41:39'),(6,21,'coursename','التحيز الجنسي يتجلى من خلال الحواجز','Arabic','Hashir','2021-11-17 09:24:32','PNU','2021-12-08 06:36:44'),(7,21,'description','كشكل خفي من التمييز بين الجنسين ، ينطوي التحيز الجنساني على حواجز تنبع من المعتقدات الثقافية حول النوع الاجتماعي وهياكل وممارسات مكان العمل. تستلزم هذه الحواجز أفعال استبعاد غير انعكاسية تدعمها معايير وممارسات النوع الاجتماعي. يمكن أن يؤدي تراكم هذه الحواجز إلى إعاقة قدرة النساء على رؤية أنفسهن كقائدات وقدرة الآخرين على رؤيتهن كقائدات (Diehl & Dzubinski، 2017؛ Ely، et al.، 2011).','Arabic','Hashir','2021-11-17 09:24:32','PNU','2021-12-08 06:35:28'),(8,22,'coursename','التواصل بين الأشخاص في القيادة','Arabic','Hashir','2021-11-17 09:24:32','PNU','2021-12-08 06:38:40'),(9,22,'description',NULL,'Arabic','Hashir','2021-11-17 09:24:32','PNU','2021-12-08 06:38:40'),(10,21,'info','teach','English','Hashir','2021-11-17 09:44:02','PNU','2021-11-18 10:23:06'),(11,21,'info',NULL,'Arabic','Hashir','2021-11-17 09:44:02','PNU','2021-11-21 09:11:31'),(12,22,'info','teacher a','English','Hashir','2021-11-17 09:44:02','PNU','2021-11-23 09:41:39'),(13,22,'info',NULL,'Arabic','Hashir','2021-11-17 09:44:02','PNU','2021-11-23 09:41:39'),(14,13,'about_pnu','Women\'s education in the Kingdom of Saudi Arabia has been receiving a great deal of care and attention, which has allowed Saudi women to take confident and steady steps toward realizing their aspirations and has given them the opportunity to demonstrate excellence in various fields. They have been able to stand out, not only at the domestic level, but also on the international stage, where Saudi women are becoming well-known scholars and intellectuals. They have made a name for themselves in international forums and in various fields of science, achieving success and proving themselves at least as competent as their peers in other developed countries.','English','Hashir','2021-11-17 09:55:22','PNU','2022-01-04 00:44:52'),(15,13,'about_program','Virtual Reality Courses','English','Hashir','2021-11-17 09:55:22','PNU','2021-12-27 10:19:16'),(16,13,'about_pnu',NULL,'Arabic','Hashir','2021-11-17 09:55:22','PNU','2021-12-30 07:18:59'),(17,13,'about_program',NULL,'Arabic','Hashir','2021-11-17 09:55:22','PNU','2021-12-30 07:18:59'),(56,15,'choices','Woman A','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(57,16,'choices','Man A','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(58,17,'choices','Man D','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(59,18,'choices','Woman B','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(60,19,'choices','Because there is only 1 female candidate, her chances of being hired is higher than the male candidates.','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(61,20,'choices','It is necessary to assess the female candidate’s social status and responsibilities (familial responsibilities) before hiring her','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(62,21,'choices','The hiring committee should inquire about the female candidate’s leadership abilities prior to finalizing its decision.','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(63,22,'choices','Gender should not affect the hiring decision. The highest performing and skilled candidate should be hired. ','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(64,23,'choices','Regardless of gender, hiring should be based on who this committee believes can perform best based on skills and past experience ','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(65,24,'choices','I’d rather remain silent and keep my opinion to myself','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(66,25,'choices','I agree. A female should not be hired as a leader for this department','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(67,26,'choices','The female candidate should be hired because I believe in empowering women.','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(68,27,'choices','That’s silly. There are qualified people to choose from because I’m not experienced to lead the division/department','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(69,28,'choices','The IT division/department will need to change its strategy','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(70,29,'choices','Leading this department will be hard if I’m pulled into two directions: my career and family. It will be hard to try to give my best to two worlds at the same time','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(71,30,'choices','I am confident in my abilities to take on this position','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(72,31,'choices','There i