','2021-12-23 13:51:55'),(1952,706,'choices','عمر','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-23 13:51:55'),(1953,707,'choices','Because there is only 1 female candidate, her chances of being hired is higher than the male candidates.','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1954,707,'choices','نظرًا لوجود مرشحة واحدة فقط، فإن فرص توظيفها أعلى من المرشحين الذكور.','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1955,708,'choices','It is necessary to assess the female candidate’s social status and responsibilities (familial responsibilities) before hiring her.','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1956,708,'choices','من الضروري تقييم الوضع الاجتماعي للمرشحة والمسؤوليات (المسؤوليات العائلية) قبل توظيفها.','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1957,709,'choices','Gender should not affect the hiring decision. The highest performing and skilled candidate should be hired.','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1958,709,'choices',' يجب ألا يؤثر الجنس على قرار التوظيف. يجب توظيف المرشح الأعلى أداءً وماهرة','Arabic','PNU','2021-12-06 11:44:51','PNU','2022-01-03 16:36:43'),(1959,710,'choices','The hiring committee should inquire about the female candidate’s leadership abilities prior to finalizing its decision.','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1960,710,'choices','يجب على لجنة التوظيف الاستفسار عن القدرات القيادية للمرشحة قبل الانتهاء من قرارها.','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:19:51'),(1961,711,'choices','“The female candidate should be hired because I believe in empowering women.”','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1962,711,'choices','\"يجب تعيين المرشحة لأنني أؤمن بتمكين المرأة\".','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1963,712,'choices','“I agree. A female should not be hired as a leader for this department.”','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1964,712,'choices','\"أنا موافق. لا ينبغي تعيين امرأة كقائدة لهذا القسم \".','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1965,713,'choices','“Regardless of gender, hiring should be based on who this committee believes can perform best based on skills and past experience.”','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1966,713,'choices','\"بغض النظر عن الجنس، يجب أن يعتمد التوظيف على من تعتقد هذه اللجنة أنه يمكن أن يؤدي بشكل أفضل بناءً على المهارات والخبرة السابقة.\"','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:52'),(1967,714,'choices','I’d rather remain silent and keep my opinion to myself','English','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:53'),(1968,714,'choices','أفضل التزام الصمت والاحتفاظ برأيي لنفسي.','Arabic','PNU','2021-12-06 11:44:51','PNU','2021-12-08 08:27:53'),(1969,715,'choices','“That’s silly. There are qualified people to choose from because I’m not experienced to lead the division/department.”','English','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1970,715,'choices','\"هذا سخيف. هناك أشخاص مؤهلون للاختيار من بينهم لأنني لست من ذوي الخبرة لقيادة القسم\".','Arabic','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1971,716,'choices','“The IT division/department will need to change its strategy.”','English','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1972,716,'choices','\"سيحتاج قسم تكنولوجيا المعلومات إلى تغيير استراتيجيته.\"','Arabic','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1973,717,'choices','“I am confident in my abilities to take on this position.”','English','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1974,717,'choices',' \"أنا واثق من قدراتي على تولي هذا المنصب.\"','Arabic','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1975,718,'choices','“Leading this department will be hard if I’m pulled into two directions: my career and family. It will be hard to try to give my best to two worlds at the same time.”','English','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1976,718,'choices','\"قيادة هذا القسم ستكون صعبة إذا انجذبت إلى اتجاهين: حياتي المهنية وعائلتي. سيكون من الصعب محاولة تقديم أفضل ما لدي لعالمين في نفس الوقت \".','Arabic','PNU','2021-12-06 11:44:52','PNU','2021-12-08 08:27:53'),(1985,720,'choices','choice a','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1986,720,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1987,721,'choices','choice a','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1988,721,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1989,722,'choices','choice a','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1990,722,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1991,723,'choices','choice a','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1992,723,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1993,724,'choices','choice b','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1994,724,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1995,725,'choices','choice c','English','PNU','2021-12-07 07:23:24','PNU','2021-12-07 07:23:24'),(1996,725,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(1997,726,'choices','choice d','English','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(1998,726,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(1999,727,'choices','choice a','English','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(2000,727,'choices',NULL,'Arabic','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(2001,728,'choices','choice a','English','PNU','2021-12-07 07:23:25','PNU','2021-12-07 07:23:25'),(2002,728,'cho